// src/pages/Dashboard.js

import React, { useEffect, useState } from 'react';
import { Grid, Paper, Typography } from '@mui/material';
import axios from '../api/axiosConfig';

const Dashboard = () => {
  const [stats, setStats] = useState({ users: 0, workOrders: 0 });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [usersRes, workOrdersRes] = await Promise.all([
          axios.get('/api/users/count'),
          axios.get('/api/work-orders/count'),
        ]);
        setStats({
          users: usersRes.data.count,
          workOrders: workOrdersRes.data.count,
        });
      } catch (error) {
        console.error(error);
      }
    };
    fetchStats();
  }, []);

  return (
    <Grid container spacing={3}>
      {/* Users Card */}
      <Grid item xs={12} md={6}>
        <Paper elevation={3} sx={{ padding: 2 }}>
          <Typography variant="h6">Total Users</Typography>
          <Typography variant="h3">{stats.users}</Typography>
        </Paper>
      </Grid>
      {/* Work Orders Card */}
      <Grid item xs={12} md={6}>
        <Paper elevation={3} sx={{ padding: 2 }}>
          <Typography variant="h6">Total Work Orders</Typography>
          <Typography variant="h3">{stats.workOrders}</Typography>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Dashboard;
